import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent {

}
<div class="header">
    <div class="header-title">
        <h1>FitFolio</h1>
    </div>
    <div class="header-links">
        <ul>
            <li>
                <a href="#">Login/Register</a>
            </li>
        </ul>
    </div>
</div>
